import React from 'react'
import Card from './Card'
import CardSection from './CardSection'
import MultiAvatarUnit from './MultiAvatarUnit'

class ExplanationCard extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <Card>
        <CardSection>
          <div class="row">
            <img className="avatar avatar-sml" src="/images/temp-avatar5.jpg" />
          </div>
          <div class="row">
            <MultiAvatarUnit />
            <p className="follows-multi-avatar-unit font-color-light-grey inline-block"></p>
          </div>
        </CardSection>
      </Card>
    )
  }
}

export default ExplanationCard
